import React from 'react';
import './App.css';
import CreateChat from "./components/createchat/createchat"
import VideoChat from "./components/videochat/videochat"
import { Grommet } from 'grommet';
import { BrowserRouter as Router, Route } from "react-router-dom"

const TITLE = "Support The Fight Against COVID-19 While Sheltering In Place"
const DESC = `As the coronavirus crisis continues, those on the frontlines need our support. This website aims to enable more people to help while 
staying safe at home. Right now we can only talk to friends and family online or on the phone. This website provides a video call service powered
by ads and donates that ad revenue to the WHO COVID-19 Emergency Response fund.`
function App() {
  return (
    <Grommet plain>

      <Router>
        <Route exact path="/">
          <CreateChat />
        </Route>
        <Route path="/rooms/:id">
          <VideoChat />
        </Route>
      </Router>
    </Grommet>
  );
}

export default App;
